import React from "react";
import ReactDOMClient from "react-dom/client";
import "./css/main.css";

class Program extends React.Component {
  state = {
    date: "Old text",
  };
  render() {
    return (
      <div>
        <h1>{this.state.date}</h1>
        <button
          onClick={() => {
            this.setState({ date: "New text" });
          }}
        >
          Enter
        </button>
      </div>
    );
  }
}
export default Program;
const link = ReactDOMClient.createRoot(document.getElementById("test"));
link.render(<Program />);
